<>
<h1>My Favorite pets</h1>

<div className="faveMain" >

{props.favList.map(x=> <FavLine key={x.id} id={x.id} photo={x.photo} animalName={x.animalName} size={x.size} status={x.status}></FavLine> )}



</div>

</>
)}

